import React from 'react';
import flying from './flying.svg'

const Error:React.FC = () => {
    return (
        <div className='error'>
            <img className='' src={flying} alt='error'></img>
            <h1>Какой-то сверхразум все сломал</h1>
            <p>Постараемся быстро починить</p>
            <p></p>
        </div>
    );
};

export default Error;
